import { Outlet, Link } from "react-router-dom";

const Layout = () => {
  return (
    <>
       <div>
        <div>
		    <title>Apprendre le Japonais</title>
	    </div>
	    <body>
		    <div class="header">
			    <a href="#">Accueil</a>
			    <h1>Apprendre le Japonais</h1>
			    <Link to="/aide">Aide</Link>
		    </div>
        </body>
</div>
      <Outlet />
    </>
  )
};

export default Layout;
